    "Do you prefer to use captions in English or in your language?": "\u0412\u044b \u043f\u0440\u0435\u0434\u043f\u043e\u0447\u0438\u0442\u0430\u0435\u0442\u0435 \u0432\u043a\u043b\u044e\u0447\u0430\u0442\u044c \u0441\u0443\u0431\u0442\u0438\u0442\u0440\u044b \u043d\u0430 \u0430\u043d\u0433\u043b\u0438\u0439\u0441\u043a\u043e\u043c \u0438\u043b\u0438 \u043d\u0430 \u0441\u0432\u043e\u0435\u043c \u0440\u043e\u0434\u043d\u043e\u043c \u044f\u0437\u044b\u043a\u0435?",
