    "How satisfied are you with this experience?": "\u041d\u0430\u0441\u043a\u043e\u043b\u044c\u043a\u043e \u0432\u044b \u0434\u043e\u0432\u043e\u043b\u044c\u043d\u044b \u043d\u043e\u0432\u044b\u043c \u043e\u043f\u044b\u0442\u043e\u043c?",
    "How satisfied are you with this new experience?": "\u041d\u0430\u0441\u043a\u043e\u043b\u044c\u043a\u043e \u0432\u044b \u0434\u043e\u0432\u043e\u043b\u044c\u043d\u044b \u043d\u043e\u0432\u044b\u043c \u043e\u043f\u044b\u0442\u043e\u043c?",
    "How satisfied are you with this tool to edit captions?": "\u041d\u0430\u0441\u043a\u043e\u043b\u044c\u043a\u043e \u0432\u044b \u0434\u043e\u0432\u043e\u043b\u044c\u043d\u044b \u044d\u0442\u0438\u043c \u0438\u043d\u0441\u0442\u0440\u0443\u043c\u0435\u043d\u0442\u043e\u043c \u0434\u043b\u044f \u0440\u0435\u0434\u0430\u043a\u0442\u0438\u0440\u043e\u0432\u0430\u043d\u0438\u044f \u0441\u0443\u0431\u0442\u0438\u0442\u0440\u043e\u0432?",
    "How was your search experience?": "\u041a\u0430\u043a\u043e\u0432\u044b \u0432\u0430\u0448\u0438 \u0432\u043f\u0435\u0447\u0430\u0442\u043b\u0435\u043d\u0438\u044f \u043e\u0442 \u0440\u0435\u0437\u0443\u043b\u044c\u0442\u0430\u0442\u043e\u0432 \u043f\u043e\u0438\u0441\u043a\u0430?",
