    "How would you rate the quality of this course?": "\u041a\u0430\u043a \u0431\u044b \u0432\u044b \u043e\u0446\u0435\u043d\u0438\u043b\u0438 \u043a\u0430\u0447\u0435\u0441\u0442\u0432\u043e \u043a\u0443\u0440\u0441\u0430?",
