    "I can hear audio clearly, but I cannot understand the instructor": "\u0417\u0432\u0443\u043a \u0447\u0435\u0442\u043a\u0438\u0439, \u043d\u043e \u044f \u043d\u0435 \u043f\u043e\u043d\u0438\u043c\u0430\u044e \u0440\u0435\u0447\u0438 \u043f\u0440\u0435\u043f\u043e\u0434\u0430\u0432\u0430\u0442\u0435\u043b\u044f",
