    "Once your course is live on our marketplace, students will be able to\n                        discover and purchase it. You'll earn money every time a student\n                        purchases your course.": "\u041a\u0430\u043a \u0442\u043e\u043b\u044c\u043a\u043e \u043a\u0443\u0440\u0441 \u0431\u0443\u0434\u0435\u0442 \u043e\u043f\u0443\u0431\u043b\u0438\u043a\u043e\u0432\u0430\u043d \u0438 \u043e\u043a\u0430\u0436\u0435\u0442\u0441\u044f \u043d\u0430 \u0442\u043e\u0440\u0433\u043e\u0432\u043e\u0439 \u043f\u043b\u043e\u0449\u0430\u0434\u043a\u0435, \u0441\u0442\u0443\u0434\u0435\u043d\u0442\u044b \u0441\u043c\u043e\u0433\u0443\u0442 \u043d\u0430\u0439\u0442\u0438 \u0435\u0433\u043e\n                        \u0438 \u043a\u0443\u043f\u0438\u0442\u044c. \u0412\u044b \u0437\u0430\u0440\u0430\u0431\u0430\u0442\u044b\u0432\u0430\u0435\u0442\u0435 \u0434\u0435\u043d\u044c\u0433\u0438 \u043f\u0440\u0438 \u043a\u0430\u0436\u0434\u043e\u0439\n                        \u043f\u043e\u043a\u0443\u043f\u043a\u0435 \u0432\u0430\u0448\u0435\u0433\u043e \u043a\u0443\u0440\u0441\u0430 \u043d\u043e\u0432\u044b\u043c \u0441\u0442\u0443\u0434\u0435\u043d\u0442\u043e\u043c.",
