    "Please be aware, we do not allow persons or companies with private\n                         label rights to resell content that they purchased from a content\n                         owner on Udemy.": "\u041f\u043e\u043c\u043d\u0438\u0442\u0435, \u0447\u0442\u043e \u0447\u0430\u0441\u0442\u043d\u044b\u043c \u043b\u0438\u0446\u0430\u043c \u0438 \u043a\u043e\u043c\u043f\u0430\u043d\u0438\u044f\u043c \u0441 \u043f\u0440\u0430\u0432\u0430\u043c\u0438 \u043d\u0430 \u0438\u0441\u043f\u043e\u043b\u044c\u0437\u043e\u0432\u0430\u043d\u0438\u0435 \u0441\u043e\u0431\u0441\u0442\u0432\u0435\u043d\u043d\u043e\u0439\n                         \u0442\u043e\u0440\u0433\u043e\u0432\u043e\u0439 \u043c\u0430\u0440\u043a\u0438 \u0437\u0430\u043f\u0440\u0435\u0449\u0435\u043d\u043e \u043f\u0435\u0440\u0435\u043f\u0440\u043e\u0434\u0430\u0432\u0430\u0442\u044c \u043c\u0430\u0442\u0435\u0440\u0438\u0430\u043b\u044b,\n                         \u043f\u0440\u0438\u043e\u0431\u0440\u0435\u0442\u0435\u043d\u043d\u044b\u0435 \u0443 \u0432\u043b\u0430\u0434\u0435\u043b\u044c\u0446\u0430 \u043c\u0430\u0442\u0435\u0440\u0438\u0430\u043b\u043e\u0432 \u043d\u0430 Udemy.",
    "Please briefly and considerately share why:": "\u041a\u043e\u0440\u043e\u0442\u043a\u043e \u0438 \u0447\u0435\u0442\u043a\u043e \u0432\u044b\u0441\u043a\u0430\u0436\u0438\u0442\u0435\u0441\u044c \u043e:",
    "Please check that you've provided the correct information below\n                        and try again.": "\u0423\u0431\u0435\u0434\u0438\u0442\u0435\u0441\u044c, \u0447\u0442\u043e \u0443\u043a\u0430\u0437\u0430\u043d\u043d\u0430\u044f \u0432\u0430\u043c\u0438 \u043d\u0438\u0436\u0435 \u0438\u043d\u0444\u043e\u0440\u043c\u0430\u0446\u0438\u044f \u0432\u0435\u0440\u043d\u0430,\n                        \u0438 \u043f\u043e\u043f\u0440\u043e\u0431\u0443\u0439\u0442\u0435 \u0441\u043d\u043e\u0432\u0430.",
