    "Please complete the premium instructor application \n                <a %(attributes)s>here</a>  in order to set a price for your course. You can set \n                your course price as soon as your linked payment method is approved. ": "\u0417\u0430\u043f\u043e\u043b\u043d\u0438\u0442\u0435 \u0437\u0430\u044f\u0432\u043a\u0443 \u043f\u0440\u0435\u043c\u0438\u0443\u043c-\u043f\u0440\u0435\u043f\u043e\u0434\u0430\u0432\u0430\u0442\u0435\u043b\u044f \n                <a %(attributes)s>\u043f\u043e \u0441\u0441\u044b\u043b\u043a\u0435</a>, \u0447\u0442\u043e\u0431\u044b \u0443\u0441\u0442\u0430\u043d\u043e\u0432\u0438\u0442\u044c \u0446\u0435\u043d\u0443 \u043d\u0430 \u0441\u0432\u043e\u0439 \u043a\u0443\u0440\u0441. \u0412\u044b \u043c\u043e\u0436\u0435\u0442\u0435 \u0443\u0441\u0442\u0430\u043d\u043e\u0432\u0438\u0442\u044c \n                \u0446\u0435\u043d\u0443 \u0434\u043b\u044f \u0441\u0432\u043e\u0435\u0433\u043e \u043a\u0443\u0440\u0441\u0430 \u0441\u0440\u0430\u0437\u0443 \u043f\u043e\u0441\u043b\u0435 \u0442\u043e\u0433\u043e, \u043a\u0430\u043a \u0441\u0432\u044f\u0437\u0430\u043d\u043d\u044b\u0439 \u043c\u0435\u0442\u043e\u0434 \u043e\u043f\u043b\u0430\u0442\u044b \u0431\u0443\u0434\u0435\u0442 \u043f\u043e\u0434\u0442\u0432\u0435\u0440\u0436\u0434\u0435\u043d. ",
    "Please confirm that you want to add this course to your cart.": "\u041f\u043e\u0436\u0430\u043b\u0443\u0439\u0441\u0442\u0430, \u043f\u043e\u0434\u0442\u0432\u0435\u0440\u0434\u0438\u0442\u0435, \u0447\u0442\u043e \u0432\u044b \u0445\u043e\u0442\u0438\u0442\u0435 \u0434\u043e\u0431\u0430\u0432\u0438\u0442\u044c \u044d\u0442\u043e\u0442 \u043a\u0443\u0440\u0441 \u0432 \u043a\u043e\u0440\u0437\u0438\u043d\u0443.",
