    "Students searching for your Topic also search for these Topics. This list is sorted by highest interest to lowest interest.": "\u0421\u0442\u0443\u0434\u0435\u043d\u0442\u044b, \u0432\u044b\u043f\u043e\u043b\u043d\u044f\u0432\u0448\u0438\u0435 \u043f\u043e\u0438\u0441\u043a \u043f\u043e \u0432\u0430\u0448\u0435\u0439 \u0442\u0435\u043c\u0435, \u0442\u0430\u043a\u0436\u0435 \u0438\u0441\u043a\u0430\u043b\u0438 \u0441\u043b\u0435\u0434\u0443\u044e\u0449\u0438\u0435 \u0442\u0435\u043c\u044b. \u042d\u0442\u043e\u0442 \u0441\u043f\u0438\u0441\u043e\u043a \u043e\u0442\u0441\u043e\u0440\u0442\u0438\u0440\u043e\u0432\u0430\u043d \u043f\u043e \u0441\u0442\u0435\u043f\u0435\u043d\u0438 \u0437\u0430\u0438\u043d\u0442\u0435\u0440\u0435\u0441\u043e\u0432\u0430\u043d\u043d\u043e\u0441\u0442\u0438 \u043f\u043e \u0443\u0431\u044b\u0432\u0430\u044e\u0449\u0435\u0439.",
    "Students want to know who\u2019s teaching them. Even for a course that is mostly screencasts, film yourself for your introduction. Or go the extra mile and film yourself introducing each section!": "\u0421\u0442\u0443\u0434\u0435\u043d\u0442\u0430\u043c \u0432\u0430\u0436\u043d\u043e \u0437\u043d\u0430\u0442\u044c, \u043a\u0442\u043e \u0432\u0435\u0434\u0435\u0442 \u043b\u0435\u043a\u0446\u0438\u044e. \u0414\u0430\u0436\u0435 \u0435\u0441\u043b\u0438 \u0432\u0430\u0448 \u043a\u0443\u0440\u0441 \u0432 \u043e\u0441\u043d\u043e\u0432\u043d\u043e\u043c \u0441\u043e\u0441\u0442\u043e\u0438\u0442 \u0438\u0437 \u0441\u043a\u0440\u0438\u043d\u043a\u0430\u0441\u0442\u043e\u0432 \u0438 \u0434\u0435\u043c\u043e\u043d\u0441\u0442\u0440\u0430\u0446\u0438\u0438 \u043d\u0430\u0433\u043b\u044f\u0434\u043d\u044b\u0445 \u043c\u0430\u0442\u0435\u0440\u0438\u0430\u043b\u043e\u0432, \u043d\u0430\u0447\u043d\u0438\u0442\u0435 \u043b\u0435\u043a\u0446\u0438\u044e \u0441 \u0432\u0432\u0435\u0434\u0435\u043d\u0438\u044f \u0438 \u043f\u043e\u043a\u0430\u0436\u0438\u0442\u0435 \u0441\u0435\u0431\u044f \u0441\u0442\u0443\u0434\u0435\u043d\u0442\u0430\u043c. \u041c\u043e\u0436\u043d\u043e \u043f\u043e\u0439\u0442\u0438 \u0435\u0449\u0435 \u0434\u0430\u043b\u044c\u0448\u0435, \u043f\u0440\u0438\u043b\u043e\u0436\u0438\u0442\u044c \u0447\u0443\u0442\u044c \u0431\u043e\u043b\u044c\u0448\u0435 \u0443\u0441\u0438\u043b\u0438\u0439 \u0438 \u0441\u0434\u0435\u043b\u0430\u0442\u044c \u043d\u0435\u0431\u043e\u043b\u044c\u0448\u043e\u0439 \u0432\u0432\u043e\u0434\u043d\u044b\u0439 \u0440\u043e\u043b\u0438\u043a \u043e\u0442 \u043f\u0435\u0440\u0432\u043e\u0433\u043e \u043b\u0438\u0446\u0430 \u043f\u0435\u0440\u0435\u0434 \u043d\u0430\u0447\u0430\u043b\u043e\u043c \u043a\u0430\u0436\u0434\u043e\u0433\u043e \u0440\u0430\u0437\u0434\u0435\u043b\u0430!",
