    "Teach what you love. You can create a course on almost anything. Millions of students are\n                            waiting, eager to learn.": "\u0423\u0447\u0438\u0442\u0435 \u0442\u043e\u043c\u0443, \u0447\u0442\u043e \u043b\u044e\u0431\u0438\u0442\u0435. \u0412\u044b \u043c\u043e\u0436\u0435\u0442\u0435 \u0441\u043e\u0437\u0434\u0430\u0442\u044c \u043a\u0443\u0440\u0441 \u043f\u043e\u0447\u0442\u0438 \u043d\u0430 \u043b\u044e\u0431\u0443\u044e \u0442\u0435\u043c\u0443. \u041c\u0438\u043b\u043b\u0438\u043e\u043d\u044b \u0441\u0442\u0443\u0434\u0435\u043d\u0442\u043e\u0432\n                            \u0436\u0430\u0436\u0434\u0443\u0442 \u0443\u0447\u0438\u0442\u044c\u0441\u044f.",
