    "Turn off fans or air vents, and record at a time when it\u2019s quiet. Place acoustic foam or blankets on the walls, and bring in rugs or furniture to dampen echo.": "\u0417\u0430\u043f\u0438\u0441\u044b\u0432\u0430\u0439\u0442\u0435 \u0437\u0432\u0443\u043a \u0432 \u0442\u0438\u0445\u043e\u0439 \u043e\u0431\u0441\u0442\u0430\u043d\u043e\u0432\u043a\u0435; \u0435\u0441\u043b\u0438 \u0440\u0430\u0431\u043e\u0442\u0430\u044e\u0442 \u0432\u0435\u043d\u0442\u0438\u043b\u044f\u0442\u043e\u0440 \u0438\u043b\u0438 \u043a\u043e\u043d\u0434\u0438\u0446\u0438\u043e\u043d\u0435\u0440, \u0432\u044b\u043a\u043b\u044e\u0447\u0438\u0442\u0435 \u0438\u0445. \u0417\u0430\u043a\u0440\u043e\u0439\u0442\u0435 \u0441\u0442\u0435\u043d\u044b \u0448\u0443\u043c\u043e\u043f\u043e\u0434\u0430\u0432\u043b\u044f\u044e\u0449\u0438\u043c \u043c\u0430\u0442\u0435\u0440\u0438\u0430\u043b\u043e\u043c \u0438 \u043e\u0434\u0435\u044f\u043b\u0430\u043c\u0438, \u043f\u0440\u0435\u0434\u043c\u0435\u0442\u044b \u043c\u0435\u0431\u0435\u043b\u0438 \u0438 \u043a\u043e\u0432\u0440\u044b \u0442\u0430\u043a\u0436\u0435 \u043f\u043e\u043c\u043e\u0433\u0430\u044e\u0442 \u043f\u0440\u0438\u0433\u043b\u0443\u0448\u0438\u0442\u044c \u044d\u0445\u043e.",
    "Turn off overhead lights. Experiment with three point lighting by placing two lamps in front of you and one behind aimed on the background.": "\u0421\u0432\u0435\u0442 \u0434\u043e\u043b\u0436\u0435\u043d \u0445\u043e\u0440\u043e\u0448\u043e \u043e\u0441\u0432\u0435\u0449\u0430\u0442\u044c \u043c\u0435\u0441\u0442\u043e \u0441\u044a\u0435\u043c\u043a\u0438 \u0438 \u0432\u0430\u0448\u0435 \u043b\u0438\u0446\u043e. \u0412\u044b\u043a\u043b\u044e\u0447\u0438\u0442\u0435 \u0432\u0435\u0440\u0445\u043d\u0438\u0439 \u0441\u0432\u0435\u0442; \u0440\u0430\u0431\u043e\u0442\u0430\u0439\u0442\u0435 \u0441 \u0442\u0440\u0435\u043c\u044f \u0438\u0441\u0442\u043e\u0447\u043d\u0438\u043a\u0430\u043c\u0438 \u0441\u0432\u0435\u0442\u0430: \u0434\u0432\u0435 \u043b\u0430\u043c\u043f\u044b \u043f\u043e\u0441\u0442\u0430\u0432\u044c\u0442\u0435 \u043f\u0435\u0440\u0435\u0434 \u0441\u043e\u0431\u043e\u0439, \u0430 \u043e\u0434\u043d\u0443 \u2014 \u0437\u0430 \u0441\u043e\u0431\u043e\u0439, \u043d\u0430\u043f\u0440\u0430\u0432\u0438\u0432 \u0435\u0435 \u043e\u0442 \u0441\u0435\u0431\u044f \u043d\u0430 \u0444\u043e\u043d.",
    "Turn the gain to about halfway and adjust if needed": "\u0412\u043a\u043b\u044e\u0447\u0438\u0442\u0435 \u0443\u0441\u0438\u043b\u0435\u043d\u0438\u0435 \u043d\u0430 \u043f\u043e\u043b\u043e\u0432\u0438\u043d\u0443 \u043e\u0442 \u043c\u0430\u043a\u0441\u0438\u043c\u0443\u043c\u0430 \u0438 \u043e\u0442\u0440\u0435\u0433\u0443\u043b\u0438\u0440\u0443\u0439\u0442\u0435 \u0435\u0433\u043e, \u0435\u0441\u043b\u0438 \u043d\u0435\u043e\u0431\u0445\u043e\u0434\u0438\u043c\u043e",
