    "Udemy has given me the opportunity to reach a global\n            audience for my classes that wouldn\u2019t have been possible otherwise.": "\u0411\u043b\u0430\u0433\u043e\u0434\u0430\u0440\u044f Udemy \u0443 \u043c\u0435\u043d\u044f \u043f\u043e\u044f\u0432\u0438\u043b\u0430\u0441\u044c \u0430\u0443\u0434\u0438\u0442\u043e\u0440\u0438\u044f \u0441\u0442\u0443\u0434\u0435\u043d\u0442\u043e\u0432\n            \u0441\u043e \u0432\u0441\u0435\u0433\u043e \u043c\u0438\u0440\u0430, \u043e \u043a\u043e\u0442\u043e\u0440\u043e\u0439 \u0440\u0430\u043d\u044c\u0448\u0435 \u043c\u043e\u0436\u043d\u043e \u0431\u044b\u043b\u043e \u0442\u043e\u043b\u044c\u043a\u043e \u043c\u0435\u0447\u0442\u0430\u0442\u044c.",
